script: |
  super -f text -I q8640.spq | sort > q8640.out

inputs:
  - name: q8640.spq
    data: |
      SELECT col0 + - 16 * col0 / - CAST ( - ( col1 ) AS INTEGER ) + col1 - - ( - + 78 ) + - ( - col2 ) / + col0 / - - 55 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 68 * + 10 IS NOT NULL;
  - name: tab2

outputs:
  - name: q8640.out
    data: |
